  `i_cema_sort_order` int(6) DEFAULT '0',
  `i_sf_bay_area_sort_order` int(6) DEFAULT '0',
  `s_professional_partner` varchar(100) DEFAULT NULL COMMENT 'Scroll area to mark each partner (not sure used)',
  `s_personal_phone` varchar(15) DEFAULT NULL,
  `s_personal_fax` varchar(15) DEFAULT NULL,
  `s_personal_street` varchar(60) DEFAULT NULL,
  `s_personal_unit` varchar(50) DEFAULT NULL,
  `i_personal_city_id` int(5) DEFAULT NULL,
  `i_personal_state_id` int(5) DEFAULT NULL,
  `i_personal_country_id` int(5) DEFAULT NULL,
  `s_personal_postal_code` varchar(10) DEFAULT NULL,
  `i_sort_order` int(11) NOT NULL,
  `rs_oauth_access_key` varchar(100) DEFAULT NULL,
  `rs_oauth_access_secret` varchar(100) DEFAULT NULL,
  `rs_oauth_request_key` varchar(100) DEFAULT NULL,
  `rs_oauth_request_secret` varchar(100) DEFAULT NULL,
  `rs_oauth_verifier` varchar(100) DEFAULT NULL,
  `rs_oauth_token` varchar(100) DEFAULT NULL,
  `i_total_post` int(10) NOT NULL DEFAULT '0' COMMENT 'total business post count',
  `i_total_active` int(10) NOT NULL DEFAULT '0' COMMENT 'total active business count',
  `i_total_expired` int(10) NOT NULL DEFAULT '0' COMMENT 'total expired business count',
  `dt_start` datetime DEFAULT NULL,
  `dt_termination` datetime DEFAULT NULL,
  `i_front_display` tinyint(4) DEFAULT '1' COMMENT '1->Yes, 0->No',
  PRIMARY KEY (`i_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='User Type comes from the mp_admin_user_type table';

