DROP TABLE IF EXISTS `ams_user_role`;
CREATE TABLE `ams_user_role` (
  `i_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `i_region_id` int(11) unsigned DEFAULT NULL,
  `i_franchise_id` int(11) DEFAULT NULL,
