INSERT INTO `ams_user` VALUES ('3', 'Admin', 'Corporate', 'corporate@gmail.com', 'corporate@gmail.com', 'adb8835820ebfbfb94d78a5023ba2e03', '2015-05-26 12:05:39', '1', '', '', '2', '1', 'No', '1', null, null, 'default', 'Corporate', 'CMEA, SBA, MBA', 'test', 'test', '2', 'Address', '0', 'city', '123435', '121-212-1212', '1232132', 'test', '0', '43', '0', null, 'Saty has over 30 years of experience in the chemical industry and was involved in several aspects of business and operations management. He has an MBA from Louisiana State University and engineering degrees from the University of Virginia. \r\n\r\nHe provides business consulting and business brokerage services through a Murphy Business Brokerage franchise. He is a certified CMEA. He takes a personal approach in working with clients to meet their special needs. His goal is to ensure that the transaction yields the best deal for his client while making the process easy, personable, and painless.\r\n\r\nHe also owns Padgett Business Services of Mobile with his wife, Anna, and provides financial, accounting, and tax services serving small business clients. From operating this business, he has extensive experience in working with small businesses and enjoys assisting them in their day to day issues. His clients appreciate his common sense approach, excellent customer support, and personable nature.\r\n\r\nHe is an active member of the Mobile Downtown Rotary Club and the Mobile Chamber of Commerce. He was Chamber Ambassador of the year in 2011. His hobbies are tennis, running, and reading.', 'test,Broker,Broken,Corporate Admin,Murphy Business', '0', '0', '0', '0', '0', '0', '0', 'test', '', '', '', '', '0', '0', '0', '', '5', null, null, null, null, null, null, '0', '0', '0', null, null, '0');
